import styled from "styled-components";


const Hex = styled.polygon`
cursor: pointer;
fill-opacity: 0.4;
stroke: #000;
stroke-width: 1;
transition: transform, fill-opacity, stroke-width;
-webkit-transition: transform, fill-opacity, stroke-width;
transition-duration: 1s;
-webkit-transition-duration: 1s;
fill: #ffff00;
transform-origin: 50% 50%;
transform: rotate(30);
&:hover{
  fill-opacity: 1;
  stroke: #ff0000;
  stroke-width: 5;
}
`


export function HexComponent() {

  return (
    <svg height="800" width="100%" viewBox="0 0 800 600">
      <g id="hex">
        <Hex points="150,75 112,140 37,140 0,75 37,10 112,10">test</Hex>
      </g>
    </svg>
  );
}
